import React, { useState } from 'react';
import './App.css';

import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
// import Grid from 'react-bootstrap/Grid'


import Container from 'react-bootstrap/Container';
import Jumbotron from './components/Jumbotron';
import Card from './components/Card';
import Team from './components/Team';

const App = () => (
  <>
      <div className='container my-3 py-5 text-center'>
        <h1>Our Team</h1>
        <p>Our team works hard to come up with the cutest couple cartoons around!</p>
      </div>

      <div class="jumbotron">
        <h1 style='text-align: center; color: white;'>Our Partners</h1>      
        <p style="color: white;"> Check out friends who make great entertaining content!!!</p>
      </div>

      <Team/>
  </>
);

export default App;
